import './Header.css';
import logo from '../../images/logo2.png';
import UsersRemotePanel from '../UsersRemotePanel/UsersRemotePanel';
import SearchForm from '../SearchForm/SearchForm';


export default function Header() {
  return (
    <header className="header">
      <div className='header_block_1'></div>
      <div className='header_block_2'>
        <img className='logo_theme_light' src={logo}/>
        <UsersRemotePanel/>
      </div>
      <nav className='header_block_3'>
        <ul className='header__menu'>
          <li className='navlink_size_m'>Каталог</li>
          <li className='navlink_size_m'>Бусы</li>
          <li className='navlink_size_m'>Серьги</li>
          <li className='navlink_size_m'>Кольца</li>
          <li className='navlink_size_m'>Подвески</li>
          <li className='navlink_size_m'>Комплекты</li>
          <li className='navlink_size_m'>Броши</li>
          <li className='navlink_size_m'>Новинки</li>
          <li className='navlink_size_m'>Распродажа</li>
        </ul>
        <section className='search'>
          <SearchForm/>
        </section>
      </nav>
    </header>
  )
}

// Что есть в шапочке: 
// - лого и название
// - форма поиска 
// - номер телефона 
// - пользов-е иконки: корзина, избранное, профиль (мб, заказы)
// - основное меню по товарам
// - хлебные крошки как на ламоде?
// - опционально: инфа о доставке, город покупателя, инфа об оплате, как мы работаем, о нас
